import Navbar from "./Navbar";
import Menu from "./Menu";
import Footer from "./Footer";

export default function Information(){

return(
    <div>
            <div>
                <Navbar />
            </div>
            <div>
                <Menu />
            </div>
            <link href="https://fonts.googleapis.com/css2?family=Raleway:wght@400;700&display=swap" rel="stylesheet"></link>
        <div>
            <div> QUIENES SOMOS
Eko surge en la ciudad de San Carlos de Bariloche con el propósito de fomentar el cuidado del medio ambiente. Nuestro objetivo es lograr reemplazar la utilización del plástico de un solo uso comercializando productos con materiales alternativos sustentables.

Desde eKo consideramos que cambiar hábitos cotidianos, es generar cambios para un futuro sostenible, logrando “contagiar” a otras personas para impulsar un movimiento mayor. </div>
                
        
        </div>
        <div>
            <Footer />
        </div>
        </div>
)
}
